import { DAT_GHE, SET_CHI_TIET_PHONG_VE } from "../types/QuanLyDatVeType";

const initialState = {
    chiTietPhongVe: {},
    danhSachGheDangDat: []
};

export default (state = initialState, action) => {
    switch (action.type) {
        case SET_CHI_TIET_PHONG_VE: {
            return { ...state, chiTietPhongVe: action.chiTietPhongVe };
        }
        case DAT_GHE: {

            return { ...state };
        }

        default:
            return state;
    }
};
